import React, { Component } from 'react';
import logo from '../../logo.svg';
import './Header.css';

export default class Header extends Component {
    constructor() {
        super();
        this.state = {
            red: true,
            tile1: "red"
        };
    }

    render() {
        return (
            <div id="navWrap">
                <a href="" class="logo">Logo/Brand</a>
                <nav class="nav">
                    <ul>
                        <li></li>
                        <li></li>

                    </ul>
                </nav>
            </div>
        );
    }
}
